The Crash: The Coming Financial Collapse of America...from Jeremiah Films

America must borrow more than a billion dollars a day to help pay the interest on our
national debt! What does this mean for our future? How can we protect our families?
Hear expert economic analysis from Larry Burkett, Ed Meese, U.S. Senator Trent Lott, and others.

In the CRA$H, you'll hear the truth the government doesn't want you to know:

&quot;If the United States Government continues to spend more than it's taking in, we're headed for economic collapse.&quot;
ED MEESE, - Former U.S. Attorney General

&quot;We face the possibility of a depression that could make the depression of 1929 look like a mild recession by comparison.&quot;
MARK RITCHIE, -Commodity Trading Advisor

&quot;Washington is irrevocably out of control. Congress has to find ways to pay its bills. And the only cash its got available is yours.&quot;
CHUCK MISSLER, - Executive, Author

&quot;Every bit of waste in the Federal Government has a champion somewhere in Congress who sees it not as waste, but as a gravy train.&quot;
GROVER NORQUIST, - Economist, U.S. Chamber of Commerce

&quot;It's time for a second American revolution at the ballot box...&quot;
BILL DANNEMEYER, - U.S. Congressman

&quot;Were going to have an economic collapse... God is doing everything spiritually possible to awaken His people.&quot;
LARRY BURKETT, - Economist, Author



